export const initialState = {
    quotes: [],
    isFetching: null,
    error:""
}

const reducer = (state = initialState, action) => {
    switch(action.type){
        case FETCH_QUOTES_SUCCESS:
            return
        default:
            return state;
    }
}

export default reducer;
